import React from 'react';
import SocialLinkIcon from '../socialLinkIcon';

import './style.css';

const Header = () => {
  const socialLinkData = [
    {
      href: 'https://www.facebook.com/',
      iconClass: 'fa-facebook-f'
    },
    {
      href: 'https://www.twitter.com/',
      iconClass: 'fa-twitter'
    },
    {
      href: 'https://www.google.com/',
      iconClass: 'fa-google'
    },
    {
      href: 'https://www.linkedin.com/',
      iconClass: 'fa-linkedin-in'
    },
    {
      href: 'https://www.github.com/',
      iconClass: 'fa-github'
    },
    {
      href: 'https://www.skype.com/',
      iconClass: 'fa-skype'
    }
  ];

  return (
    <header>
      <div className="header-content-data">
        <h1 className="person-name">Jonh Doe</h1>
        <h3 className="speciality">Software Engineer</h3>
      </div>
      <div className="header-content-links">
        {
          socialLinkData.map(({ href, iconClass }) => (<SocialLinkIcon key={href} href={href} iconClass={iconClass}/>))
        }
      </div>
    </header>
  )
};

export default Header;
